import React from 'react';
import MyCard from '../../../General/Card/card.js'
import BestDestinations from './bestdestJson.js'
import './bestdest.css'

class BestDests extends React.Component{
  render() {
    const bestdestCards = BestDestinations.map(oneitem =>
        <MyCard
           id = {oneitem.id}
           classN = {oneitem.classN}
           img_variant = {oneitem.img.variant}
           img_src = {oneitem.img.src}
           img_classN = {oneitem.img.className}
           title = {oneitem.title}
           text = {oneitem.text}
           btn_variant = {oneitem.button.variant}
           btn = {oneitem.button.btn}
         />
       )
    return (
      <div className = "row mt-2 justify-content-center">
        {bestdestCards}
      </div>
    )
  }
}
export default BestDests
